import React, { Component } from 'react';

import { Link } from 'react-router-dom';
//import './Header.css';

class Header extends Component {
    render() {
        return (
           
            <div>
                <Link to="/">홈</Link>
                <Link to="/Posts">포스트</Link>
                
            </div>
        );
    }
}

export default Header;
